import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Login from './Login/Login'; // Your Login component
import Register from './Register/Register'; // Your Register component
// import Dashboard from './Dashboard'; // Omit this if Dashboard is not yet created
import { AuthProvider } from './AuthContext';

function App() {
  return (
    <BrowserRouter>
      <AuthProvider>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/register" element={<Register />} />
          {/* When Dashboard is ready, you can uncomment and use the line below */}
          {/* <Route path="/dashboard" element={<Dashboard />} /> */}
          {/* Define other routes as needed */}
        </Routes>
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
